import React from "react";
import Navbar from "../Component/Navbar";
import CarbonCalculator from "../Component/Calc";
import Landing from "../Component/Landing";
function Home() {
  return (
    <div>
        <Navbar /><br></br><br></br><br></br>
        <div style={{ position: 'relative', zIndex: 1 }}>
      <CarbonCalculator />
      </div>
      <Landing />
    </div>
  );
}

export default Home;
